package tray

import (
	"encoding/base64"
	"os/exec"
	"runtime"
	"strings"
)

var IconBlackBase64 string = `
`

var IconWhiteBase64 string = `
`

var IconRedBase64 string = `
`

func IconWhiteBytes() []byte {
	data, err := base64.StdEncoding.DecodeString(IconWhiteBase64)
	if err != nil {
		return nil
	}

	return data
}

func IconBlackBytes() []byte {
	data, err := base64.StdEncoding.DecodeString(IconBlackBase64)
	if err != nil {
		return nil
	}

	return data
}

func IconRedBytes() []byte {
	data, err := base64.StdEncoding.DecodeString(IconRedBase64)
	if err != nil {
		return nil
	}

	return data
}

// IsDarkMode detect dark mode or not.
// Only working for macos for now.
func IsDarkMode() bool {
	if runtime.GOOS == "darwin" {
		out, err := exec.Command(
			"/usr/bin/defaults",
			"read",
			"-g",
			"AppleInterfaceStyle",
		).Output()
		if err != nil {
			return false
		}

		return strings.Contains(string(out), "Dark")
	}

	return false
}

// Icon return icon
func Icon() []byte {
	if IsDarkMode() {
		return IconWhiteBytes()
	}

	return IconBlackBytes()
}
